import React from "react";

function App() {
  return (
    <div className="site-inner">
      <div className="wrap">
        <div className="content-sidebar-wrap">
          <main className="content"></main>
          <aside className="sidebar"></aside>
        </div>
      </div>
    </div>
  );
}

export default App;
